import React from "react";
import MainPage from "./pages/MainPage/MainPage";
import "./App.css";
import Header from "./pages/MainPage/Header/Header";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Korzina from "./pages/Korzina/Korzina";
import Login from "./pages/Login/Login";
import PizzaCard from "./components/PizzaCard/PizzaCard";
import SnacksCard from './components/SnacksCard/SnacksCard'
import Footer from "./pages/MainPage/Footer/Footer";

function App() {
    return (
      <div className="background">
        <div className="wrapper">
            <Router>
            <Header />
            <OftenOrder />
            <Categorie />
              <Routes>
                <Route path="/" element={<MainPage />}/> 
                <Route path="/Korzina" element={<Korzina />}/> 
                <Route path="/Back" element={<MainPage/>}/> 
                <Route path="/Login" element={<Login/>}/> 
                <Route path="/Back from Login" element={<MainPage/>}/> 
                <Route path="/PizzaCard" element={<PizzaCard />} />
                <Route path="/SnacksCard" element={<SnacksCard />} />
              </Routes>
              <Footer/>
            </Router>
        </div>
      </div>
    );
}

export default App;
